appraisal.p:
Het archief is geselecteerd aan de hand van de volgende selectielijsten en handelingen:
BSD 046 Voorlichting van de Rijksoverheid, Staatscourant 14 juni 2007, nr. 204;
BSD 071 Kunsten, 1945-, Staatscourant 30 mei 2007, nrs. 10, 11, 15, 16, 17, 19, 274, 275;
BSD 103A Buitenland, 1945-1990, Staatscourant 9 september 2002, nrs. 44, 62, 68, 560, 686, 687, 690;
BSD 143 Organisatie Rijksoverheid, Staatscourant 16 december 2005, nr. 283;
BSD 186 Het Nederlands Buitenlands Beleid, 1990-2006, Staatscourant 19 oktober 2007, nrs. 1, 2, 4, 5, 6, 11, 44, 55, 66, 69, 73, 76, 99 en 120;
Dit archief bevat tevens bescheiden die bewaard worden op grond van de hardheidsclausule art. 5 lid e van het Archiefbesluit 1995.
Voor de bewerking had het archief een omvang van 107 meter. Hiervan is 17,5 meter voor bewaring in aanmerking gekomen en 88,6 meter vernietigd. Van de te vernietigen archiefbescheiden zijn vernietigingslijsten opgesteld. Deze lijsten zijn aan het ministerie van Buitenlandse Zaken overgedragen. De op termijn te vernietigen archiefbescheiden zijn geretourneerd aan de zorgdrager.
